import React, { Component } from "react";
import { Button, Badge, Jumbotron, Container } from "reactstrap";

class Test extends Component {
  constructor(props) {
    super(props);

    this.state = {
      user: "Archita",
    };
  }
  changeUser() {
    this.setState({
      user: this.state.user === "Himanshu" ? "Archita" : "Himanshu",
    });
  }
  render() {
    return (
      <div>
        <Jumbotron>
          <Container fluid>
            <Badge color="secondary">
              <h1>{this.state.user}'s App</h1>
            </Badge>
            <br />
            <Button color="info" onClick={() => this.changeUser()}>
              Alter
            </Button>
          </Container>
        </Jumbotron>
      </div>
    );
  }
}

export default Test;
